class MaxHeap {
    constructor() {
        this.array = [null];
    }

    getParent(idx) {
        return Math.floor(idx / 2);
    }

    getLeftChild(idx) {
        return idx * 2;
    }
    
    getRightChild(idx) {
        return (idx * 2) + 1;
    }

    siftUp(idx) {
        if (idx === 1) return;

        let parentIdx = this.getParent(idx);
        let parentVal = this.array[parentIdx];
        let currentVal = this.array[idx];

        if (currentVal > parentVal) {
            [this.array[parentIdx], this.array[idx]] = 
            [this.array[idx], this.array[parentIdx]];
            this.siftUp(parentIdx);
        }
        // if (idx === 1) return;

        // let parentIdx = this.getParent(idx);

        // if (this.array[parentIdx] < this.array[idx]) {
        //     [this.array[parentIdx], this.array[idx]] = [
        //     this.array[idx], this.array[parentIdx]];
        //     this.siftUp(parentIdx);
        // }
        
    }

    insert(val) {
        this.array.push(val);
        this.siftUp(this.array.length - 1);
    }

    siftDown(idx) {
        let ary = this.array;
        let leftChildIdx = this.getLeftChild(idx);
        let rightChildIdx = this.getRightChild(idx);
        let leftChildVal = ary[leftChildIdx];
        let rightChildVal = ary[rightChildIdx];

        if (leftChildVal === undefined) leftChildVal = -Infinity;
        if (rightChildVal === undefined) rightChildVal = -Infinity;

        // base case
        if (ary[idx] > leftChildVal && ary[idx] > rightChildVal) {
          return;
        }
        // recursive step
        let swapIdx;
        if (ary[leftChildIdx] < ary[rightChildIdx]) {
            swapIdx = rightChildIdx;
        } else {
            swapIdx = leftChildIdx;
        }

        [ary[idx], ary[swapIdx]] = [ary[swapIdx], ary[idx]];
        this.siftDown(swapIdx);
    }

    deleteMax() {
        if (this.array.length === 1) return null;
        if (this.array.length === 2) return this.array.pop();
        let max = this.array[1];
        let last = this.array[this.array.length - 1];
        this.array[1] = last;
        this.array.pop();
        this.siftDown(1);
        return max;
    }
}

